jQuery(document).ready(function(){$('a[href="#"]').click(function(c){c.preventDefault()});$('[data-toggle="tooltip"]').tooltip();var a=(function(){var j=new Date();var e=j.getDay();var i=["Sunday","Monday","Tuesday","Wednesday","Thursday","Friday","Saturday"];var c=j.getDate();var h=j.getMonth();var g=["January","February","March","April","May","June","July","August","September","October","November","December"];var f=j.getYear()+1900;switch(c){case (c%10)==1:c+="<sup>St</sup>";break;case (c%10)==2:c+="<sup>Nd</sup>";break;case (c%10)==3:c+="<sup>Rd</sup>";break;default:c+="<sup>Th</sup>"}return{day:i[e],date:c,month:g[h],year:f}})();$(".todayDateTop").empty().append(a.day+", "+a.date+" "+a.month+" "+a.year);function b(){var g=new Date();var e=(g.getMinutes()>9)?g.getMinutes():0+""+g.getMinutes();var f=(g.getSeconds()>9)?g.getSeconds():0+""+g.getSeconds();var c=g.getHours();var h=(c>12)?(c-12):c;h=(h>9)?h:0+""+h;_ts=(c>12)?"PM":"AM";$(".actualTimeTop").empty().append(h+":"+e+":"+f+""+_ts)}b();setInterval(b,1000)});